import React from 'react';
import Img from '../../images/movie.jpg';
import { MovieImg, MovieWrapper,M } from './movieelements';

function movie() {
    return (


        <div>
          <MovieContainer>
          <MovieWrapper>
             <MovieImg className="profileuserimg"
                             src={Img}
                             alt=""/>
         </MovieWrapper>
         </MovieContainer>
            
        </div>
    )
}

export default movie
